Java for-each Loop The for-each loop is used to traverse array or collection in java. It is easier to use than simple for loop because we don't need to increment value and use subscript notation.


It works on elements basis not index. It returns element one by one in the defined variable.


Syntax:


for(Type var:array){
 		//code to be executed
 }



Java While Loop
 The Java while loop is used to iterate a part of the program several times. If the number of iteration is not fixed, it is recommended to use while loop.

 Syntax:
 while(condition){
 	//code to be executed
 }


Example:


public class WhileExample { 
 public static void main(String[] args) { 
 			int i=1;
 			while(i<=10){
 				System.out.println(i); 			i++; 
 } 
 } 
 } 


Java do-while Loop

 The Java do-while loop is used to iterate a part of the program several times. If the number of iteration is not fixed and you must have to execute the loop at least once, it is recommended to use do-while loop.


The Java do-while loop is executed at least once because condition is checked after loop body.


Syntax:


do{ 
 		//code to be executed 
 }while(condition);

Java Break Statement When a break statement is encountered inside a loop, the loop is immediately terminated and the program control resumes at the next statement following the loop.


The Java break is used to break loop or switch statement. It breaks the current flow of the program at specified condition. In case of inner loop, it breaks only inner loop.


We can use Java break statement in all types of loops such as for loop, while loop and do-while loop.


Syntax:


jump-statement;
 break;



Java Break Statement with Loop


Example:


//Java Program to demonstrate the use of break statement
 //inside the for loop. 
 public class BreakExample { 
 public static void main(String[] args) { 
 		//using for loop 
 		for(int i=1;i<=10;i++){
 			if(i==5){ 
 				//breaking the loop
 				break; 
 } 
 System.out.println(i); 
 } 
 } 
 } 



Output: 		1
 		2
 		3
 		4

Java Continue Statement The continue statement is used in loop control structure when you need to jump to the next iteration of the loop immediately. It can be used with for loop or while loop.

 The Java continue statement is used to continue the loop. It continues the current flow of the program and skips the remaining code at the specified condition. In case of an inner loop, it continues the inner loop only.

 We can use Java continue statement in all types of loops such as for loop, while loop and do-while loop.


Syntax:

 jump-statement;
 continue;

Interface in Java

 An interface in java is a blueprint of a class. It has static constants and abstract methods.

 The interface in Java is a mechanism to achieve abstraction. There can be only abstract methods in the Java interface, not method body. It is used to achieve abstraction and multiple inheritance in Java.

 In other words, you can say that interfaces can have abstract methods and variables. It cannot have a method body.


Why use Java interface?

 There are mainly three reasons to use interface. They are given below.

		It is used to achieve abstraction.
 		By interface, we can support the functionality of multiple inheritance.
 		It can be used to achieve loose coupling.


Syntax:

 interface <interface_name >{ 

			// declare constant fields 
 			// declare methods that abstract 
 			// by default. 
 }

