A storage class defines the scope (visibility) and life-time of variables and/or functions within a C Program. They precede the type that they modify. We have four different storage classes in a C program -


auto
 register
 static
 extern
 The auto Storage Class
 The auto storage class is the default storage class for all local variables.

 {
 int mount;
 auto int month;
 }

 The example above defines two variables with in the same storage class. auto can only be used within functions, i.e., local variables.
The register Storage Class The register storage class is used to define local variables that should be stored in a register instead of RAM. This means that the variable has a maximum size equal to the register size (usually one word) and cannot have the unary & operator applied to it (as it does not have a memory location).


{
 register int miles;
 }

 The register should only be used for variables that require quick access such as counters. It should also be noted that defining register does not mean that the variable will be stored in a register. It means that it MIGHT be stored in a register depending on hardware and implementation restrictions.

Strings are actually one dimensional array of characters terminated by a null character . Thus a null terminated string contains the characters that comprise the string followed by a null.
The following declaration and initialization create a string consisting of the word "Hello". To hold the null character at the end of the array, the size of the character array containing the string is one more than the number of characters in the word "Hello."


char greeting[6] = {H, e, l, l, o, 0};

 If you follow the rule of array initialization then you can write the above statement as follows
char greeting = "Hello";

Arrays allow to define type of variables that can hold several data items of the same kind. Similarly structure is another user defined data type available in C that allows to combine data items of different kinds.

 Structures are used to represent a record. Suppose you want to keep track of your books in a library. You might want to track the following attributes about each book


Title
 Author
 Subject
 Book ID
 Defining a Structure
 To define a structure, you must use the struct statement. The struct statement defines a new data type, with more than one member. The format of the struct statement is as follows


struct structure tag {


member definition;
 member definition;
 member definition;
 } one or more structure variables; 

 The structure tag is optional and each member definition is a normal variable definition, such as int i; or float f; or any other valid variable definition. At the end of the structure definition, before the final semicolon, you can specify one or more structure variables but it is optional. Here is the way you would declare the Book structure 


struct Books {
 char title 50;
 char author 50 ;
 char subject 100;
 int book_id;
 } book;

A union is a special data type available in C that allows to store different data types in the same memory location. You can define a union with many members, but only one member can contain a value at any given time. Unions provide an efficient way of using the same memory location for multiple purpose.

Defining a Union To define a union, you must use the union statement in the same way as you did while defining a structure. The union statement defines a new data type with more than one member for your program. The format of the union statement is as follows 


union union tag {
 member definition;
 member definition;
 member definition;
 } one or more union variables;

Suppose your C program contains a number of TRUE/FALSE variables grouped in a structure called status, as follows 


struct {
 unsigned int widthValidated;
 unsigned int heightValidated;
 } status;
 This structure requires 8 bytes of memory space but in actual, we are going to store either 0 or 1 in each of the variables. The C programming language offers a better way to utilize the memory space in such situations.


If you are using such variables inside a structure then you can define the width of a variable which tells the C compiler that you are going to use only those number of bytes. For example, the above structure can be re written as follows 


struct {
 unsigned int widthValidated : 1;
 unsigned int heightValidated : 1;
 } status;

Type casting is a way to convert a variable from one data type to another data type. For example, if you want to store a long value into a simple integer then you can type cast long to int. You can convert the values from one type to another explicitly using the cast operator as follows 


